from flask import jsonify

from cyborg.app.openapi.roche import roche_blueprint
from cyborg.modules.partner.roche.application.response import RocheAppResponse


@roche_blueprint.route('/openapi/v1/vendor', methods=['get'])
def vendor():
    res = RocheAppResponse(data={
        'vendor_information': {
            'company_name': 'dipath',
            'company_logo': 'data:image/png;base64,'
        }
    })

    return jsonify(res.dict())
